import { IconFileText, IconBomb, IconWall, IconApple } from '@tabler/icons-react';
import NavIcon from './Icons/NavIcon.jsx'
function NavBar() {
    return (
        <div class="flex flex-col justify-center items-center my-2">
            <div class="flex flex-row justify-center between rounded-lg bg-gray-300 w-9/12">
                <NavIcon Icon={IconBomb}/>
            </div>
        </div>
    )
}

export default NavBar;
